      .catch((error) => {
        const errorCode = error.code;
        const errorMessage = error.message;
        // ..
      });
  };
  return (
    // <Todo/>
    <>

        <Header/>
        <Signup getData={getData} />

        <Login/>


    </>
  );
}

export default App;
